"use strict";(self.webpackChunkdocs=self.webpackChunkdocs||[]).push([[976],{6014:e=>{e.exports=JSON.parse('{"version":{"pluginId":"default","version":"current","label":"Next","banner":null,"badge":false,"noIndex":false,"className":"docs-version-current","isLast":true,"docsSidebars":{"tutorialSidebar":[{"type":"link","label":"Dollar Overview","href":"/DollarDiscordBot/docs/overview","docId":"overview","unlisted":false},{"type":"category","label":"Music","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Music Commands Overview","href":"/DollarDiscordBot/docs/Music/overview","docId":"Music/overview","unlisted":false},{"type":"category","label":"Commands","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"!empty","href":"/DollarDiscordBot/docs/Music/Commands/Empty","docId":"Music/Commands/Empty","unlisted":false},{"type":"link","label":"!generateplaylist","href":"/DollarDiscordBot/docs/Music/Commands/GeneratePlaylist","docId":"Music/Commands/GeneratePlaylist","unlisted":false},{"type":"link","label":"!join","href":"/DollarDiscordBot/docs/Music/Commands/Join","docId":"Music/Commands/Join","unlisted":false},{"type":"link","label":"!leave","href":"/DollarDiscordBot/docs/Music/Commands/Leave","docId":"Music/Commands/Leave","unlisted":false},{"type":"link","label":"!lofi","href":"/DollarDiscordBot/docs/Music/Commands/Lofi","docId":"Music/Commands/Lofi","unlisted":false},{"type":"link","label":"!lyrics","href":"/DollarDiscordBot/docs/Music/Commands/Lyrics","docId":"Music/Commands/Lyrics","unlisted":false},{"type":"link","label":"!next","href":"/DollarDiscordBot/docs/Music/Commands/Next","docId":"Music/Commands/Next","unlisted":false},{"type":"link","label":"!nowplaying","href":"/DollarDiscordBot/docs/Music/Commands/NowPlaying","docId":"Music/Commands/NowPlaying","unlisted":false},{"type":"link","label":"!pause","href":"/DollarDiscordBot/docs/Music/Commands/Pause","docId":"Music/Commands/Pause","unlisted":false},{"type":"link","label":"!play","href":"/DollarDiscordBot/docs/Music/Commands/Play","docId":"Music/Commands/Play","unlisted":false},{"type":"link","label":"!playskip","href":"/DollarDiscordBot/docs/Music/Commands/Playskip","docId":"Music/Commands/Playskip","unlisted":false},{"type":"link","label":"!queue","href":"/DollarDiscordBot/docs/Music/Commands/Queue","docId":"Music/Commands/Queue","unlisted":false},{"type":"link","label":"!remove","href":"/DollarDiscordBot/docs/Music/Commands/Remove","docId":"Music/Commands/Remove","unlisted":false},{"type":"link","label":"!replay","href":"/DollarDiscordBot/docs/Music/Commands/Replay","docId":"Music/Commands/Replay","unlisted":false},{"type":"link","label":"!resume","href":"/DollarDiscordBot/docs/Music/Commands/Resume","docId":"Music/Commands/Resume","unlisted":false},{"type":"link","label":"!seek","href":"/DollarDiscordBot/docs/Music/Commands/Seek","docId":"Music/Commands/Seek","unlisted":false},{"type":"link","label":"!shuffle","href":"/DollarDiscordBot/docs/Music/Commands/Shuffle","docId":"Music/Commands/Shuffle","unlisted":false},{"type":"link","label":"!skip","href":"/DollarDiscordBot/docs/Music/Commands/Skip","docId":"Music/Commands/Skip","unlisted":false},{"type":"link","label":"!swap","href":"/DollarDiscordBot/docs/Music/Commands/Swap","docId":"Music/Commands/Swap","unlisted":false}]}]},{"type":"category","label":"Slash","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Slash Commands Overview","href":"/DollarDiscordBot/docs/Slash/overview","docId":"Slash/overview","unlisted":false},{"type":"category","label":"Commands","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"/dollarsettings","href":"/DollarDiscordBot/docs/Slash/Commands/DollarSettings","docId":"Slash/Commands/DollarSettings","unlisted":false},{"type":"link","label":"/embedcreator","href":"/DollarDiscordBot/docs/Slash/Commands/EmbedCreator","docId":"Slash/Commands/EmbedCreator","unlisted":false},{"type":"link","label":"/featurerequest","href":"/DollarDiscordBot/docs/Slash/Commands/FeatureRequest","docId":"Slash/Commands/FeatureRequest","unlisted":false},{"type":"link","label":"/help","href":"/DollarDiscordBot/docs/Slash/Commands/Help","docId":"Slash/Commands/Help","unlisted":false},{"type":"link","label":"/reportbug","href":"/DollarDiscordBot/docs/Slash/Commands/ReportBug","docId":"Slash/Commands/ReportBug","unlisted":false},{"type":"link","label":"/status","href":"/DollarDiscordBot/docs/Slash/Commands/Status","docId":"Slash/Commands/Status","unlisted":false}]}]},{"type":"category","label":"Moderation","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Overview of Key Features","href":"/DollarDiscordBot/docs/Moderation/overview","docId":"Moderation/overview","unlisted":false},{"type":"category","label":"Features","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Auto Channel Creation","href":"/DollarDiscordBot/docs/Moderation/Features/AutoChannelCreation","docId":"Moderation/Features/AutoChannelCreation","unlisted":false},{"type":"link","label":"Inactivity Timeout","href":"/DollarDiscordBot/docs/Moderation/Features/Inactivity","docId":"Moderation/Features/Inactivity","unlisted":false},{"type":"link","label":"Message Moderation","href":"/DollarDiscordBot/docs/Moderation/Features/Messages","docId":"Moderation/Features/Messages","unlisted":false}]}]},{"type":"category","label":"Context Menu","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Overview of Context Menu Commands","href":"/DollarDiscordBot/docs/Context Menu/overview","docId":"Context Menu/overview","unlisted":false},{"type":"category","label":"Commands","collapsible":true,"collapsed":true,"items":[{"type":"link","label":"Poke User","href":"/DollarDiscordBot/docs/Context Menu/Commands/PokeUser","docId":"Context Menu/Commands/PokeUser","unlisted":false},{"type":"link","label":"User Information","href":"/DollarDiscordBot/docs/Context Menu/Commands/UserInfo","docId":"Context Menu/Commands/UserInfo","unlisted":false}]}]}]},"docs":{"Context Menu/Commands/PokeUser":{"id":"Context Menu/Commands/PokeUser","title":"Poke User","description":"The Poke User context menu command allows users to send a quick notification to another user, inviting them to join their current voice channel. This feature is ideal for bringing friends or teammates into a conversation or gaming session without needing to type out an invite message manually.","sidebar":"tutorialSidebar"},"Context Menu/Commands/UserInfo":{"id":"Context Menu/Commands/UserInfo","title":"User Information","description":"The User Information context menu command allows users to view detailed information about another member in the Discord server. It provides insights into the user\'s account, server activity, and roles in an easy-to-read embed format.","sidebar":"tutorialSidebar"},"Context Menu/overview":{"id":"Context Menu/overview","title":"Overview of Context Menu Commands","description":"Dollar provides a set of Context Menu Commands that enhance the user experience by enabling quick actions directly from the Discord right-click menu. These commands are accessible under the \\"Apps\\" submenu when right-clicking on a user or a message, offering convenient tools for server moderation and user management.","sidebar":"tutorialSidebar"},"Moderation/Features/AutoChannelCreation":{"id":"Moderation/Features/AutoChannelCreation","title":"Auto Channel Creation","description":"The Auto Channel Creation feature allows Dollar to automatically create personalized voice channels for users when they join a designated trigger channel. This helps maintain an organized and dynamic voice channel environment by giving users their own space while in a voice chat.","sidebar":"tutorialSidebar"},"Moderation/Features/Inactivity":{"id":"Moderation/Features/Inactivity","title":"Inactivity Timeout","description":"The Inactivity Timeout feature ensures that Dollar will automatically leave a voice channel if it detects that no music is being played for a period of time. This is managed through Lavalink and its configuration settings.","sidebar":"tutorialSidebar"},"Moderation/Features/Messages":{"id":"Moderation/Features/Messages","title":"Message Moderation","description":"The Message Moderation feature helps ensure that users interact with Dollar in the correct channels and prevents misuse by enforcing channel-specific command usage. It also handles Direct Messages (DMs) to the bot and checks for unauthorized or misplaced commands.","sidebar":"tutorialSidebar"},"Moderation/overview":{"id":"Moderation/overview","title":"Overview of Key Features","description":"Auto Channel Creation","sidebar":"tutorialSidebar"},"Music/Commands/Empty":{"id":"Music/Commands/Empty","title":"!empty","description":"The !empty command is used to clear the entire music queue in Dollar. This command is helpful when you want to remove all the songs in the current queue and start fresh, whether you\'re done with the current playlist or simply want to reset the queue.","sidebar":"tutorialSidebar"},"Music/Commands/GeneratePlaylist":{"id":"Music/Commands/GeneratePlaylist","title":"!generateplaylist","description":"The !generateplaylist command allows Dollar to generate a playlist based on user-specified filters such as genre, artist, or album. This command utilizes Spotify to search for tracks that match the provided filters, leveraging the Spotipy library to interact with the Spotify API, and then adds those tracks to the music queue for playback.","sidebar":"tutorialSidebar"},"Music/Commands/Join":{"id":"Music/Commands/Join","title":"!join","description":"The !join command is used to have Dollar join the voice channel that the user is currently in. This command is essential for initiating music playback, as it allows the bot to connect to a voice channel where it can stream audio.","sidebar":"tutorialSidebar"},"Music/Commands/Leave":{"id":"Music/Commands/Leave","title":"!leave","description":"The !leave command allows Dollar to leave the voice channel that it is currently connected to. This command is typically used when you no longer want the bot to stay in the voice channel after the music playback has finished or if you want to disconnect the bot for any other reason.","sidebar":"tutorialSidebar"},"Music/Commands/Lofi":{"id":"Music/Commands/Lofi","title":"!lofi","description":"The !lofi command allows Dollar to generate a lofi music playlist and start playing it in the voice channel. The playlist consists of relaxing, chill, and calming music, ideal for background listening while working, studying, or just relaxing.","sidebar":"tutorialSidebar"},"Music/Commands/Lyrics":{"id":"Music/Commands/Lyrics","title":"!lyrics","description":"The !lyrics command allows Dollar to fetch the lyrics for the currently playing song by searching on Genius.com. This command provides users with the ability to view the lyrics of a song directly within the Discord server while the song is playing, enhancing the listening experience.","sidebar":"tutorialSidebar"},"Music/Commands/Next":{"id":"Music/Commands/Next","title":"!next","description":"The !next command allows users to view the next song in the music queue. It provides a preview of the song that is scheduled to play after the current track finishes, giving users an idea of what to expect next.","sidebar":"tutorialSidebar"},"Music/Commands/NowPlaying":{"id":"Music/Commands/NowPlaying","title":"!nowplaying","description":"The !nowplaying command displays the current song that is playing in the voice channel. It provides users with the title and artist of the song that Dollar is playing, allowing everyone to stay informed about the track currently being played.","sidebar":"tutorialSidebar"},"Music/Commands/Pause":{"id":"Music/Commands/Pause","title":"!pause","description":"The !pause command allows users to pause the current song that is playing in the voice channel. It temporarily stops the playback, allowing users to resume later without losing the song\'s progress.","sidebar":"tutorialSidebar"},"Music/Commands/Play":{"id":"Music/Commands/Play","title":"!play","description":"The !play command allows users to play a song from YouTube Music by providing the song\'s name or a URL. This command initiates playback of the requested song in the voice channel where Dollar is connected.","sidebar":"tutorialSidebar"},"Music/Commands/Playskip":{"id":"Music/Commands/Playskip","title":"!playskip","description":"The !playskip command allows users to skip the currently playing song and immediately start playing a new song that is specified by the user. It combines the functions of skipping a song and playing a new one in a single command.","sidebar":"tutorialSidebar"},"Music/Commands/Queue":{"id":"Music/Commands/Queue","title":"!queue","description":"The !queue command allows users to view the current music queue. It displays all the songs that are waiting to be played after the current song finishes, providing users with an overview of upcoming tracks.","sidebar":"tutorialSidebar"},"Music/Commands/Remove":{"id":"Music/Commands/Remove","title":"!remove","description":"The !remove command allows users to remove a song from the music queue. It provides users the ability to manage the queue by removing unwanted or incorrectly added songs.","sidebar":"tutorialSidebar"},"Music/Commands/Replay":{"id":"Music/Commands/Replay","title":"!replay","description":"The !replay command allows users to restart the currently playing song. It enables users to replay the song from the beginning without needing to manually skip to it or search for it again.","sidebar":"tutorialSidebar"},"Music/Commands/Resume":{"id":"Music/Commands/Resume","title":"!resume","description":"The !resume command allows users to resume the song that was previously paused. It restarts the playback from the point where the song was paused, ensuring a seamless listening experience.","sidebar":"tutorialSidebar"},"Music/Commands/Seek":{"id":"Music/Commands/Seek","title":"!seek","description":"The !seek command allows users to fast forward or rewind the currently playing song to a specific time position. It provides users with control over the playback, allowing them to jump to any point in the song.","sidebar":"tutorialSidebar"},"Music/Commands/Shuffle":{"id":"Music/Commands/Shuffle","title":"!shuffle","description":"The !shuffle command allows users to randomize the order of the songs in the current music queue. It provides a way to mix up the playback, ensuring that songs are played in a random order rather than the order they were added to the queue.","sidebar":"tutorialSidebar"},"Music/Commands/Skip":{"id":"Music/Commands/Skip","title":"!skip","description":"The !skip command allows users to skip the current song that is playing and move on to the next song in the queue. It is useful for users who no longer want to listen to the current track and want to jump directly to the next one.","sidebar":"tutorialSidebar"},"Music/Commands/Swap":{"id":"Music/Commands/Swap","title":"!swap","description":"The !swap command allows users to swap the positions of two songs in the music queue. This command is useful for users who want to change the order of the songs in the queue, allowing them to reorder songs without removing or adding new ones.","sidebar":"tutorialSidebar"},"Music/overview":{"id":"Music/overview","title":"Music Commands Overview","description":"Dollar uses advanced tools to provide a seamless music experience on your server. The bot leverages Lavalink, a high-performance audio streaming server for Discord bots, to serve music. Lavalink allows Dollar to play music reliably with low latency and minimal server load, even in large servers.","sidebar":"tutorialSidebar"},"overview":{"id":"overview","title":"Dollar Overview","description":"Dollar is a feature-rich Discord bot designed to provide an exceptional experience for your server. With capabilities ranging from music management to gaming statistics, and even server settings management, Dollar makes it easy to entertain, organize, and inform your server members.","sidebar":"tutorialSidebar"},"Slash/Commands/DollarSettings":{"id":"Slash/Commands/DollarSettings","title":"/dollarsettings","description":"The /dollarsettings command allows server administrators to customize and manage specific bot settings for their Discord server. By using this command, administrators can configure Dollar\'s behavior in terms of channel management, auto-channel creation, and the selection of a voice channel for media playback (like a show or movie channel).","sidebar":"tutorialSidebar"},"Slash/Commands/EmbedCreator":{"id":"Slash/Commands/EmbedCreator","title":"/embedcreator","description":"The /embedcreator command allows users to easily create customized embed messages that can be sent to Discord channels. With this command, users can set various embed parameters, such as the title, description, thumbnail, and footer, allowing for rich and visually appealing messages that enhance user engagement.","sidebar":"tutorialSidebar"},"Slash/Commands/FeatureRequest":{"id":"Slash/Commands/FeatureRequest","title":"/featurerequest","description":"The /featurerequest command allows users to submit suggestions for new features to be added to Dollar. This command provides a simple and structured way for users to propose new ideas or improvements, helping the development team understand what the community is looking for.","sidebar":"tutorialSidebar"},"Slash/Commands/Help":{"id":"Slash/Commands/Help","title":"/help","description":"The /help command provides users with an interactive guide to Dollar\'s features and commands. It displays a user-friendly interface that organizes help topics, allowing users to quickly find information about how to use various commands and functionalities.","sidebar":"tutorialSidebar"},"Slash/Commands/ReportBug":{"id":"Slash/Commands/ReportBug","title":"/reportbug","description":"The /reportbug command allows users to report any bugs or issues they encounter while using Dollar. This command helps the development team quickly identify and resolve problems, ensuring a smooth and reliable experience for all users.","sidebar":"tutorialSidebar"},"Slash/Commands/Status":{"id":"Slash/Commands/Status","title":"/status","description":"The /status command provides users with real-time information about the current status of the server running Dollar. It displays vital metrics such as CPU usage, memory usage, and uptime, allowing users to monitor the health and performance of the bot.","sidebar":"tutorialSidebar"},"Slash/overview":{"id":"Slash/overview","title":"Slash Commands Overview","description":"Slash commands are an easy-to-use feature in Discord that allow users to interact with the bot directly through Discord\'s chat interface. These commands are initiated by typing a / followed by the command name, triggering a set of predefined actions or responses from the bot. Slash commands offer a structured and user-friendly way to interact with Dollar without needing to remember complex text commands.","sidebar":"tutorialSidebar"}}}}')}}]);